import React from 'react';
import './styles/Topbar.css'; // Import the CSS file

const Topbar = () => {
  return (
    <div className="topbar">
      <h1>Application Title</h1>
      <div className="user-info">
        <p>User Name</p>
        <button>Logout</button>
      </div>
    </div>
  );
};

export default Topbar;
